import React, {useState} from 'react';
import { View, Text, StyleSheet, Button } from 'react-native';
import Icon from 'react-native-vector-icons/Feather';
import {Picker} from '@react-native-picker/picker';
import DropDownPicker from 'react-native-dropdown-picker';

const Search = ({navigation}) => {
  const [Brand, setBrand] = useState('All');



  return (

    <View style={styles.container}>
      <Text>This is the Search Page</Text>

      <View style = {styles.brandContainer}>
      <DropDownPicker
        items={[
          {label: "All",               value: "all"},
          {label: 'Mac',              value: 'mac'},
          {label: 'Window',           value: 'window'},
          {label: "Helward Package",  value:"hp" },
          {label:"Asus",              value:"asus"},
          {label:"Acer",              value:"acer"},
          {label:"Microsoft",         value:"microsoft" },
          {label: "Dell",             value:"dell"},

        ]}
        placeholder= {"Select Brand..."}
        defaultIndex={"fsdfsdf"}
        containerStyle={{height: 40, width: 175, alignSelf: "center"}}
        onChangeItem={item => setBrand(item.value)}
      />
        </View>

        <View style = {styles.ramContainer}>
      <DropDownPicker
        items={[
          {label: "All",               value: "all"},
          {label: 'Mac',              value: 'mac'},
          {label: 'Window',           value: 'window'},
          {label: "Helward ",  value:"hp" },
          {label:"Asus",              value:"asus"},
          {label:"Acer",              value:"acer"},
          {label:"Microsoft",         value:"microsoft" },
          {label: "Dell",             value:"dell"},

        ]}
        placeholder= {"Select Brand..."}
        defaultIndex={"fsdfsdf"}
        containerStyle={{height: 40, width: 175, alignSelf: "center"}}
        onChangeItem={item => setBrand(item.value)}
      />
        </View>

        <View style = {styles.processorContainer}>
      <DropDownPicker
        items={[
          {label: "All",               value: "all"},
          {label: 'Mac',              value: 'mac'},
          {label: 'Window',           value: 'window'},
          {label: "Helward Package",  value:"hp" },
          {label:"Asus",              value:"asus"},
          {label:"Acer",              value:"acer"},
          {label:"Microsoft",         value:"microsoft" },
          {label: "Dell",             value:"dell"},

        ]}
        placeholder= {"Select Brand..."}
        defaultIndex={"fsdfsdf"}
        containerStyle={{height: 40, width: 175, alignSelf: "center"}}
        onChangeItem={item => setBrand(item.value)}
      />
        </View>

        <View style = {styles.storageContainer}>
      <DropDownPicker
        items={[
          {label: "All",               value: "all"},
          {label: 'Mac',              value: 'mac'},
          {label: 'Window',           value: 'window'},
          {label: "Helward Package",  value:"hp" },
          {label:"Asus",              value:"asus"},
          {label:"Acer",              value:"acer"},
          {label:"Microsoft",         value:"microsoft" },
          {label: "Dell",             value:"dell"},

        ]}
        placeholder= {"Select Brand..."}
        defaultIndex={"fsdfsdf"}
        containerStyle={{height: 40, width: 175, alignSelf: "center"}}
        onChangeItem={item => setBrand(item.value)}
      />
        </View>

        <View style = {styles.priceContainer}>
      <DropDownPicker
        items={[
          {label: "All",               value: "all"},
          {label: 'Mac',              value: 'mac'},
          {label: 'Window',           value: 'window'},
          {label: "Helward Package",  value:"hp" },
          {label:"Asus",              value:"asus"},
          {label:"Acer",              value:"acer"},
          {label:"Microsoft",         value:"microsoft" },
          {label: "Dell",             value:"dell"},

        ]}
        placeholder= {"Select Brand..."}
        defaultIndex={"fsdfsdf"}
        containerStyle={{height: 40, width: 175, alignSelf: "center"}}
        onChangeItem={item => setBrand(item.value)}
      />
        </View>

      <Button   
                //style={{ marginTop: 300}}
                title="View Result"
                onPress={() => navigation.navigate('Result Page')}
            />
    </View>
  );
};


const styles = StyleSheet.create({
    container: {
      flex: 1,
      alignItems: 'center',
      justifyContent: 'center',
    },
    brandContainer: {
      //position: 'absolute',
      zIndex: 5,
      margainTop: 25,

    },
    ramContainer: {
      //position: 'absolute',
      zIndex: 4,
      marginTop: 25,

    },
    processorContainer:{
      zIndex: 3,


    },
    storageContainer: {
      zIndex: 2,

    },
    priceContainer: {
      zIndex: 1,

    },
  });

export default Search;
